 wo alle 10 Minuten heulen und schluchzen und dann 10 Stunden eine lachende Lokomotive aus Menschen und Musik durch die Strassen der Stadt schnauft! \n\nWir laden euch also hiermit zu verrückten, finalen Festspielen ein. Es kommen auf euch zu: \n- eine Abschiedstour (FB ... is history!) und \n- unsere erste Greatest Hits-Platte (Hitstory), \n- Music Music Music \n- viele Surprises von unserer ewigen Bucketlist: Sachen, die wir immer schon mal machen wollten, wie die Hamburger Hafenkonzert-Safari letzten Freitag (#FettesBoot).\n\nDas Museum Fettes Brot bleibt natürlich für immer immer geöffnet. Wir möchten, dass ihr allzeit unsere Fans bleibt. Unser schöner Katalog an Alben seit 1994 wird weiterhin aufgerüscht mit Extras und Bonüssen und wie neu erscheinen (nächste Reissue-Runde ab Herbst: \"Gebäck to the future 2001 - 2010\").\n\nWer hiervon nix verpassen will, also ultra-exklusive Tour-Tickets, Platten, CDs, T-Shirts, Bücher, Bundles und sonst noch alles braucht, besucht ab 02.09.2022 unseren Bandstore unter www.fettesbrotshop.de \n\nWir sehen uns noch. \nTschüssikowski hardcore,\nFB\n\nFettes Brot ... is history Tour\n\n05.04.2023  ROSTOCK - STADTHALLE \n06.04.2023  DORTMUND - WESTFALENHALLE\n08.04.2023  BREMEN - HALLE 7\n09.04.2023  OFFENBACH - STADTHALLE\n10.04.2023  LEIPZIG - HAUS AUENSEE\n13.04.2023  AT-WIEN - GASOMETER\n14.04.2023  ERLANGEN - HEINRICH - LADES - HALLE\n15.04.2023  BIELEFELD - SEIDENSTICKERHALLE\n26.04.2023  CH-ZÜRICH - KOMPLEX 457\n27.04.2023  KÖLN - LANXESS ARENA\n28.04.2023  BERLIN - MAX SCHMELING HALLE\n01.05.2023  MÜNCHEN - ZENITH\n02.05.2023  STUTTGART - PORSCHE-ARENA\n04.05.2023  HANNOVER - SWISS LIFE HALL\n05.05.2023  MÜNSTER - MCC HALLE MÜNSTERLAND\n06.05.2023  KIEL - WUNDERINO ARENA\n\nTickets ab 02.09.2022 / 10 Uhr nur auf www.fettesbrotshop.de   \n\n#fettesbrot #history #hitstory #hiphop #rap #pop #neuemusik #tour #schwulemädchen"
