          "description": "Wenn es um Spielerberater geht, denkt man sofort an eines: Geld und Macht. Millionensummen und knallharte Verhandlungen gehören für sie zum täglichen Geschäft. Und sie kassieren dabei ordentliche Provisionen. Wenn Spielerberater wie Mino Raiola, Jorge Mendes oder Pini Zahavi bei einem einzigen Transfer bis zu 49 Millionen Euro verdienen, wundert es nicht, dass man ihnen oftmals Gier und schmutzige Methoden nachsagt - zu Recht?\n\nHier sind 4 Gründe, warum der Ruf der Spielerberater so schlecht ist.\n_______________\n\nKapitel:\n00:00 Intro\n00:24 Grund 1: Natürliche Feindschaft\n02:12 Grund 2: Millionengrab Beraterbusiness\n04:26 Grund 3: Mehr und mehr Macht, oder?\n07:32 Grund 4: Buhmänner eines kranken Systems\n_______________\n\nAutoren: Malte Möller, Anton Zirk\nKamera: Frank Vieltorf\nTon: Enisa Mirojevic\nSchnitt: Eva-Maria Arndt/ Stefan Eggers \nArt Director, Grafik: Nicolas de Leval Jezierski \nGrafik: Tanja Schangin\nRedaktion frontal: Kyo Mali Jung\nCvD Cine Impuls Leipzig: Anke Kossira \nHead of Social Media Cine Impuls Leipzig: Veronika Prütz \nTeam Cine Impuls Leipzig: Pia Schindler, Dirk Nebel, Malte Pätz, Enisa Mirojevic, Sabrina Goldack, Christine Matz\n_______________\n\nSongs im Video: \nKonstantinos Papalexopoulos, Glenn Herweijer & Ben Sumner - \"Thoughts in the Machine\"\nRussell Lewis Chimes - \"Floods\"\nThe Blue Devils & Chester James Lang - \"Grip Hop\"\nQuise B - \"Lie to Me\"\nPedram Mehrshahi & Simon Peter Astall - \"Juggernaut\"\nChel Strong - \"Wild and Dangerous\"\nRobert Edward Bradley - \"Crypto Crime\"\nThomas Jean Rolland Didier - \"Court of Appeal\"\nThe Midi Mafia feat. Chel Strong - \"King of the Wild\"\nBenjamin Tobias Franz Ringham & Maximilian John Adelbert Ringham - \"Treasure Hunting\"\nDavid Stephen Goldsmith - \"Network\"\nOliver Philippe Price & Stuart Andrew Roslyn - \"Server Failure\", \"Integration\"\nTandis Jenhudson - \"Sprawling Cities\"\nJonathan David Cotton & Ben Niblett - \"Powder\"\nLee James White & Emma Louise Cross - \"Wanna Get Paid\"\nDaniel James Roe & Jon Anthony Boorman - \"Sidestar\"\n_______________\n\nQuellen: \n\nStatistik; Die Nutznießer des Transferwahnsinns:\nhttps://de.statista.com/infografik/20211/bei-fussballtransfers-gezahlte-provisionen-an-vermittler-und-berater/\n\nFIFA-Bericht; Global spend on intermediary commissions rises to new record high of USD 653 million:\nhttps://www.fifa.com/legal/media-releases/global-spend-on-intermediary-commissions-rises-to-new-record-high-of-usd-653-mil\n\nFIFA-Bericht; INTERMEDIARIES IN INTERNATIONAL TRANSFERS 2021:\nhttps://digitalhub.fifa.com/m/1e9f687425b018af/original/Intermediaries-In-International-Transfers-2021.pdf\n\nRangliste Spieleragenten; Sports Agents List:\nhttps://www.forbes.com/sports-agents/list/#header:pay_sortreverse:true_source:Soccer\n\nStatistik; Auszahlungen für Spielerberater der Vereine der 1. Fußball-Bundesliga in der Saison 2020/2021 bzw. im Kalenderjahr 2021:\nhttps://de.statista.com/statistik/daten/studie/1128970/umfrage/vereine-1-fussball-bundesliga-auszahlungen-fuer-spielerberaternd/\n\nFINANZKENNZAHLEN; CLUBS DER BUNDESLIGA IN DER SAISON 2022-23:\nhttps://media.dfl.de/sites/2/2022/05/Clubs-der-Bundesliga-2022-23-Geschaeftsjahresende-2021.pdf \n\n_______________\n\nWillkommen bei frontal! Du kennst bestimmt schon die spannenden Dokus und Reportagen von unseren Kolleg:innen von ZDFheute Nachrichten, ZDFinfo oder ZDF Magazin Royale. frontal ist das YouTube-Format zur gleichnamigen Sendung, dem Politikmagazin des ZDF. \n________________ \n\nMehr von frontal? Jeden Dienstag gibt es auf diesem Kanal ein neues Video. \nDu willst nichts verpassen? Abonniere frontal! \nDu hast einen Themenvorschlag? Schreib uns an: frontal.youtube@cine-impuls.de \n________________\n\nMehr Infos unter:\nMediathek: https://www.zdf.de/politik/frontal#xtor=CS3-178\nTwitter: https://twitter.com/ZDFfrontal\nFacebook: https://www.facebook.com/ZDFfrontal/ \nNetiquette: https://www.zdf.de/servic